import React, {Component} from 'react';

export default class Item extends Component {
    render() {
        return (
            <li>
                <label>
                    <input type="checkbox"/>
                    <span>项目实战</span>
                </label>
                <button className="btn btn-warning" style={{display:'none'}}>删除</button>
            </li>
        )
    }
}
